IIF(
    ISNULL(FECHA_CORTE_LKP), 'ADD', 
    IIF(
         (
        TOTAL = TOTAL_LKP
         ) AND (
        CONTEO_VALIDO = CONTEO_VALIDO_LKP
        ) AND (
        CONTEO_INVALIDO = CONTEO_INVALIDO_LKP
        ) ,
        'NADA',
    'UPDATE'
    )
  )

IIF(
    ISNULL(FECHA_CORTE_LKP), 'ADD', 
    IIF(
        (
        TO_INTEGER(POBLACION_TOTAL_LKP) = TO_INTEGER(TOTAL)
        ) 
AND (
        TO_INTEGER(POBLACION_VALIDA_LKP) = TO_INTEGER(CONTEO_VALIDO)
        ) 
AND (
        TO_INTEGER(POBLACION_INVALIDO_LKP) = TO_INTEGER(CONTEO_INVALIDO)
        )     ,
    'NADA',
    'UPDATE'
    )
  )
